import React from 'react';
import './post.css'

const Table = ({ data, header }) => {

    return (
        <div className='post'>
            {data.map((item, idex) =>
                <div key={idex}>
                    <h2>{item.subject}</h2>
                    <p>{item.date}</p>
                    <td>{item.discription}</td>
                </div>
            )}
        </div>
    );
}

export default Table;




















